import React from 'react';
import { Link }  from 'react-router-dom';
import 'animate.css';
import Img1 from './drake.mp4';

let vid = document.getElementById("myVideo");
function playVid() {
  vid.play();
	vid.autoplay = true;
	document.getElementById("myVideo").load();

}

function myFunction() {
  document.getElementById("myVideo").load();
}


export default () => (
	<div className='landing'>
		<div className='info'>

		<iframe src={Img1} onloadedmetadata="this.autoplay = true" allow="autoplay" id="myVideo" type="video/mp4">
			<video controls>
			  <source src="IG.mp4" allow="autoplay" id="audio" type="video/mp4" onloadedmetadata="this.autoplay = true" allow="autoplay"/>
			</video>
		</iframe>

		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
